import { NavContent } from "./NavLogin";
import styled from "styled-components";

const NavStyledImg = styled.img`
  width: 16px;
  height: 16px;
  margin-right: 5px;
  src: ${props.src};
`;

const NavFavorite = () => {
  return (
    <NavContent>
      <img
        className="navImg"
        src="data:image/svg+xml;base64,"
      ></img>
      즐겨찾기
    </NavContent>
  );
};

export default NavFavorite;
